// router.js

import { createRouter, createWebHistory } from 'vue-router';
import App from './App.vue';
import ValidationList from './components/ValidationList.vue'; // ValidationList'ı import et

const routes = [
  {
    path: '/',
    name: 'App',
    component: App
  },
  {
    path: '/ekle', // ValidationList için yeni bir path tanımla
    name: 'ValidationList',
    component: ValidationList
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export { router };
